import React, { FunctionComponent, useEffect, useState } from 'react';
import { Link, RouteComponentProps } from 'react-router-dom';
import User from '../models/user';
import voiduser from '../models/void-user';
import Cookies from 'js-cookie';
import getCurrent from '../api-request/user/get-current';


interface Props extends RouteComponentProps<{ id: string }> {
}

const UserSettings: FunctionComponent<Props> = ({ match }) => {

    const [EditPseudo, setEditPseudo] = useState(true);
    const [EditMail, setEditMail] = useState(true);
    const [EditPassWord, setEditPassWord] = useState(true);

    const [user, setUser] = useState<User>(voiduser);

    useEffect(() => {
        const token = Cookies.get('token')
        getCurrent(token).then(result => {
            setUser(result[0])
        })

    }, [match.params.id])

    return (
        <div className='user-settings p50'>

            <div className='relative mtbauto'>
                <Link to={`/user-profile/${match.params.id}`} className="cta mb35">
                    <span>
                        Back to Profile
                    </span>
                </Link>
            </div>

            <div className="user-settings__container w30 mlrauto">
                <div className="user-settings__container__content flex-col g15">
                    <div className="user-settings__container__content__pseudo">
                        {EditPseudo ? (
                            <div className="user-settings__container__content__pseudo__title p15">
                                <h2 className='bold blue ml15 flex-bet flex-bet'>Pseudo :
                                <i className='material-icons ml10' onClick={() =>setEditPseudo(false)}>edit</i>
                                </h2>
                                <p>{user.pseudo}</p>
                            </div>
                        ) : (
                            <div className="user-settings__container__content__pseudo__editing p15">
                                <h2 className='bold blue ml15 flex-bet'>New pseudo :
                                <i className='material-icons ml10' onClick={() =>setEditPseudo(true)}>close</i></h2>
                                <input type="text" placeholder={user.pseudo} />
                                
                            </div>
                        )}
                    </div>
                    <div className="user-settings__container__content__mail">
                        {EditMail ? (
                            <div className="user-settings__container__content__mail__title p15">
                                <h2 className='bold blue ml15 flex-bet'>Email :
                                <i className='material-icons ml10' onClick={() =>setEditMail(false)}>edit</i></h2>
                                <p>{user.email}</p>
                            </div>
                        ) : (
                            <div className="user-settings__container__content__mail__editing p15">
                                <h2 className='bold blue ml15 flex-bet'>New email :
                                <i className='material-icons ml10' onClick={() =>setEditMail(true)}>close</i></h2>
                                <input type="text" placeholder={user.email} />
                            </div>
                        )}
                    </div>
                    <div className="user-settings__container__content__password">
                        {EditPassWord ? (
                            <div className="user-settings__container__content__password__title p15">
                                <h2 className='bold blue ml15 flex-bet'>Password :
                                <i className='material-icons ml10' onClick={() =>setEditPassWord(false)}>edit</i></h2>
                                <p>************</p>
                            </div>
                        ) : (
                            <div className="user-settings__container__content__password__editing p15">
                                <h2 className='bold blue ml15 flex-bet'>New password :
                                <i className='material-icons ml10' onClick={() =>setEditPassWord(true)}>close</i></h2>
                                <input type="password" />
                                <h2 className='bold blue ml15'>Confirm new password :</h2>
                                <input type="password" />
                            </div>
                        )}
                    </div>
                </div>

            </div>


        </div>
    );
}

export default UserSettings;
